import React, {useEffect, useState} from 'react';


const Main = () => {

    const[member1List , setMember1List] = useState([])

    useEffect(() => {
      fetch('http://localhost:8080/member1')
        .then(response => response.json() )
        .then(response => {
          console.log(response)
          setMember1List(response)
        })
        .catch(error => console.error('Error fetching data:', error));
    }, []);

    const memberPrint = (arr) => {

      const result = []
      for (let i = 0; i < arr.length; i++)  {

        result.push(<h3>{arr[i].mb_name}</h3>)
        result.push(<h3>{arr[i].mb_adress}</h3>)
        result.push(<h3>{arr[i].mb_tel}</h3>)
        result.push(<h3>{arr[i].mb_longtitude}</h3>)
        result.push(<h3>{arr[i].mb_latitude}</h3>)

      }
      return(
        <>
        {result}
        </>
      );
    }

    return(
      <>
      <div>
        {memberPrint(member1List)}
      </div>
      
      </>
    )
    
    
}
    
    
export default Main;
